import { Link } from 'react-router-dom';

function Registered() {
  return (
    <>
      <button className="registered">
        <Link to="sign-in" className="registered__login-link">
          Уже зарегистрированы? Войти
        </Link>
      </button>
    </>
  );
}

export { Registered };
